import { createSlice } from '@reduxjs/toolkit'

const initialState = fetch('./data.json')
  .then((res) => console.log(res.json()))
  .catch((err)=>console.log(err))

export const counterSlice = createSlice({
  name: 'counter',
  initialState
})

export default counterSlice.reducer
